import React from "react";
import "./Home.css";
import { Link, useLocation } from "react-router-dom";
import { Container, Col, Row } from "react-bootstrap";
import logoIMG from "../Resources/RC_LOGO.png";

function Home() {
  const { pathname } = useLocation();

  return (
    <section className="home-page">
      <Container>
        <Row className="align-items-center text-center">
          <Col md={1}>
            <div className = "logo">
              <Link to="/Home" aria-label="Home">
                <img src={logoIMG} alt="Renke Cui Logo" height="140" />
              </Link>
            </div>
          </Col>
          <Col md = {8}> </Col>
          <Col md={1}>
            <div className="projects-link">
              <Link
                to="/Projects"
                className={`nav-link ${
                  pathname.includes("Projects") ? "active" : ""
                }`}
                aria-current={pathname.includes("Projects") ? "page" : undefined}
              >
                Projects
              </Link>
            </div>
          </Col>
          <Col md={1}>
            <div className="about-link">
              <Link
                to="/About"
                className={`nav-link ${
                  pathname.includes("About") ? "active" : ""
                }`}
                aria-current={pathname.includes("About") ? "page" : undefined}
              >
                About Me
              </Link>
            </div>
          </Col>
          <Col md={1}> </Col>
        </Row>
      </Container>
    </section>
  );
}

export default Home;

